Storyline: Fantasy adventure directed by Sam Raimi. Acting as a prequel to the much-loved classic 'The Wizard of Oz' (1939), the film explores how the titular hero, Oscar Diggs (James Franco), a largely unsuccessful circus magician in Kansas, may have found his way to the Land of Oz and his early days in the magical realm. Seeing his new home as a world of opportunity, Oz firmly believes his luck has changed for the better when he is introduced to three witches, Theodora (Mila Kunis), Evanora (Rachel Weisz) and Glinda (Michelle Williams), who suggest that he is destined for greatness beyond his imagination. However, before Oscar can realise his true potential, he must journey through Oz and come face-to-face with the problems that haunt the fantastic land.


Cast: James Franco, Mila Kunis, Rachel Weisz, Michelle Williams, Zach Braff, Bill Cobbs, Joey King, Tony Cox
